import { MainGridFather as MainGrid } from "../system_js/mainGrid.min.js";
class App
{
    static id;
    static name;
    static THEME;
    static isMath;
    static tools;
    static data;
    static preparedToStart(data)
    {
        this.id = data.id;
        this.name = data.name;
        this.isMath = data.math;
        document.documentElement.setAttribute("theme", data.theme);
        for(let gr of data.grids)
        {
            new MainGrid(gr);
        }
        this.data = data;
    }
}
export{App};